import React, { useContext } from "react";
import { IEmployee } from "../../models/IEmployee";
import { EmployeContext } from "../../context/employe.context";
import { ItemsEmployee } from "./ItemsEmploye";
import { Column, DataTable, DataTableSelectionChangeParams } from "primereact";

export const ListEmployee = () => {
  const { employe } = useContext(EmployeContext);

  const setSelectedProducts2 = (e: DataTableSelectionChangeParams) => {
    console.log(e);
  };
  return (
    <React.Fragment>
      <h3>List Employe</h3>
      <div className="card">
        <DataTable
          value={employe}
          stripedRows
          onSelectionChange={(e) => setSelectedProducts2(e)}
          responsiveLayout="scroll"
        >
          <Column field="id_employee" header="Identificacion"></Column>
          {employe.map((value: IEmployee) => (
            <React.Fragment key={value.id_employee}>
              <Column field={value.id_person} header="id_person"></Column>
              <Column field={value.deparment} header="deparment"></Column>
              <Column field={value.salary.toString()} header="salary"></Column>
              <Column
                field={value.hours_extra.toString()}
                header="hours_extra"
              ></Column>
            </React.Fragment>
          ))}
        </DataTable>
      </div>
    </React.Fragment>
  );
};
